import './DragDrop.css';
import { fabric } from 'fabric';

import React, { Component } from 'react';

export default class DragDrop extends Component {
  componentDidMount() {
    let canvs = new fabric.Canvas();
  }
  render() {
    return <div>hello</div>;
  }
}
